import MyLayout from '../components/MyLayout';
const initialState = { count: 0 };
const reducer = (state, action) => {
  switch (action.type) {
    case 'increment':
      return { count: state.count + 1 };
    case 'decrement':
      return { count: state.count - 1 };
  }
};
const about = () => {
  return (
    <MyLayout>
      <p>This is the about page </p>
    </MyLayout>
  );
};
export default about;
